import AssistanceType from "./assistanceType";
import FirstStep from "./firstStep";
import SecondStep from "./secondStep";

import { Paper } from "@material-ui/core";
import { useState } from "react";

const AppointmentForm = () => {
  const [step, setStep] = useState(0);

  let CurrentStep;

  switch (step) {
    case 0:
      CurrentStep = <AssistanceType setStep={setStep} />;
    case 1:
      CurrentStep = <FirstStep setStep={setStep} />;
    case 2:
      CurrentStep = <SecondStep setStep={setStep} />;
    case 3:
      CurrentStep = <CompletedStep />;
  }

  return (
    <Paper align="center" style={{ height: 300, marginTop: 20, padding: 20 }}>
      <CurrentStep />
    </Paper>
  );
};

const CompletedStep = () => {
  return <h1>Completed!</h1>;
};

export default AppointmentForm;
